import '../styles/Cart.css';
import {plantList} from "../datas/plantList";

function Cart() {
    const plantes = [["Monstera", 8], ["Lierre", 10], ["Fleurs", 15]];
    const panier = "panier";
    return (
        <div className="lmj-cart">
            <h2>{panier.toUpperCase()}</h2>
            <ul>
                <li>{plantes[0][0]} : {plantes[0][1]} €</li>
                <li>{plantes[1][0]} : {plantes[1][1]} €</li>
                <li>{plantes[2][0]} : {plantes[2][1]} €</li>
            </ul>
            <p>Total : {plantes[0][1] + plantes[1][1] + plantes[2][1]} €</p>
        </div>)
}

export default Cart;
